import React from "react";
import Typewriter from "typewriter-effect";

const LandingPage = () => (
  <div className="not-fancy-font  text-white mt-20 text-30">
    <Typewriter
      onInit={(typewriter) => {
        typewriter
          .typeString(
            "Hello, I am Nika, a software engineer and an artist located in Dallas. let's create, collaborate, and connect!  "
          )

          .pauseFor(2500)

          .start();
      }}
    />
  </div>
);

export default LandingPage;
